import React from 'react';
import './App.css';
import './header.css';

const Home = () => {
  return (
    <div className="home">
      <h1>Home</h1>
    </div>
  );
};

const Menu = () => {
  return (
    <div className="menu">
      <h1>Menu</h1>
    </div>
  );
};

const Book = () => {
  return (
    <div className="book">
      <h1>Book</h1>
    </div>
  );
};

const About = () => {
  return (
    <div className="about">
      <h1>About</h1>
    </div>
  );
};

const MainContent = () => {
  return (
    <div className="main">
      <Home />
      <Menu />
      <Book />
      <About />
    </div>
  );
};

const Footer = () => {
  return (
    <div className="footer">
      <h1>Footer</h1>
    </div>
  );
};

const Header = () => {
  return (
    <div className="header">
      <a href="home.html">
        <img src="path/to/your/image.png" alt="Asset 14" />
      </a>
    </div>
  );
};

const Nav = () => {
  return (
    <nav>
      <ul>
        <li>
          <a href="home.html">Home</a>
        </li>
        <li>
          <a href="menu.html">Menu</a>
        </li>
        <li>
          <a href="book.html">Book</a>
        </li>
        <li>
          <a href="about.html">About</a>
        </li>
      </ul>
    </nav>
  );
};

export default App;
